import React, { useState } from 'react';
import './App.css';

function LoginForm({ onSubmit }) {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit({ email, password });
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="email" placeholder="Correo electrónico" value={email} onChange={(e) => setEmail(e.target.value)} />
      <input type="password" placeholder="Contraseña" value={password} onChange={(e) => setPassword(e.target.value)} />
      <button type="submit">Iniciar sesión</button>
    </form>
  );
}

function RegisterForm({ onSubmit }) {
  const [name, setName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit({ name, lastName, email, password });
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="text" placeholder="Nombre" value={name} onChange={(e) => setName(e.target.value)} />
      <input type="text" placeholder="Apellido" value={lastName} onChange={(e) => setLastName(e.target.value)} />
      <input type="email" placeholder="Correo electrónico" value={email} onChange={(e) => setEmail(e.target.value)} />
      <input type="password" placeholder="Contraseña" value={password} onChange={(e) => setPassword(e.target.value)} />
      <button type="submit">Crear cuenta</button>
    </form>
  );
}

function App() {
  const [showLoginForm, setShowLoginForm] = useState(false);
  const [showRegisterForm, setShowRegisterForm] = useState(false);

  const handleLoginSubmit = (data) => {
    // Aquí puedes manejar la lógica para enviar los datos del formulario de inicio de sesión al servidor
    console.log('Datos de inicio de sesión:', data);
  };

  const handleRegisterSubmit = (data) => {
    // Aquí puedes manejar la lógica para enviar los datos del formulario de registro al servidor
    console.log('Datos de registro:', data);
  };

  const HeaderButton = ({children, onClick}) => (
    <div className="header-button-container">
      <button className="header-button" onClick={onClick}>{children}</button>
    </div>
  );

  return (
    <div className="app">
      <header className="header">
        <div className="app-name">SixHearts</div>
        <div className="header-buttons">
          <div className="header-buttons-left">
            <div className="header-button-small header-button-dark">Inicio</div>
            <div className="header-button-small header-button-dark">Pago</div>
            <div className="dropdown">
              <button className="header-button-small header-button-dark dropbtn">Sneakers</button>
              <div className="dropdown-content">
                <a href="#">Adidas</a>
                <a href="#">Nike</a>
                <a href="#">New Balance</a>
                <a href="#">Jordan</a>
              </div>
            </div>
          </div>
          <HeaderButton onClick={() => setShowLoginForm(!showLoginForm)}>Login</HeaderButton>
          {showLoginForm && <LoginForm onSubmit={handleLoginSubmit} />}
          <HeaderButton onClick={() => setShowRegisterForm(!showRegisterForm)}>Regístrate aquí</HeaderButton>
          {showRegisterForm && <RegisterForm onSubmit={handleRegisterSubmit} />}
        </div>
      </header>
      <main className="main-content">
        <div className="presentation">
          <h1 className="title">Six Hearts</h1>
          <img className="presentation-image" src={process.env.PUBLIC_URL + '/imagenes/foto_sn.jpg'} alt="Presentación" />
        </div>
        <div className="products">
          <h2 className="title">Nuestros productos</h2>
          <div className="carousel">
            {/* Contenido del carrusel */}
          </div>
        </div>
      </main>
      <footer className="footer">
        <div className="developer-info">
          Desarrollado por: 
          <li>Santiago Gesamá Valencia - 202160013</li>
          <li>Cesar Augusto Osorio Pareja - 202159927</li>
          <li>Miguel Angel Rueda Colonia - 202159896</li>
        </div>
      </footer>
    </div>
  );
}

export default App;
